import React from "react";

const CarBox = (cars) => {
  console.log("cars in carbox", cars.make);
  return (
    <div className="carbox-container">
      <div className="car-image">
        {cars.make} {cars.model}
      </div>
    </div>
  );
};

export default CarBox;
